<p>
	 Данный формат выгрузки предназначен для экспорта товаров в Wildberries (FBS) с помощью API.
</p>
<p>
	  
</p>
<h2>Важные особенности:</h2>
<ul>
	<li>Настраивайте каждый профиль для одной категории: хотя и имеется возможность настройки для нескольких (это значит несколько похожих, а не сразу все) сразу, это будет сложнее и проблематичнее.</li>
	<li>Проверять выгрузку мы рекомендуем на одном товаре (с фильтром по ID)!</li>
	<li>Токен авторизации, указанный в поле - это т.н. refresh-токен, с помощью которого модуль регулярно получает cookie-токен WBToken, получить его можно <a href="https://seller.wildberries.ru/supplier-settings/access-to-new-api" target="_blank">здесь</a>.</li>
	<li>Перед началом настройки определитесь со способом выгрузки ТП: сначала решите, нужны ли в выгрузке товары и нужны ли торговые предложения (опция «Режим работы ТП» на вкладке «Настройки ТП»), затем определите по какой структуре должна проходить выгрузка (опция «Компоновка ТП» на вкладке «Общие настройки») - подробнее об этом написано ниже.</li>
	<li>Все привязки осуществляются по полям <code>supplierVendorCode</code> (для карточек), <code>vendorCode</code> (для номенклатур) и <code>barcode</code> (для вариаций) - подробнее об этом написано ниже.</li>
	<li>Выгрузка идёт достаточно долго, т.к. в Wildberries каждый товар отправляется отдельно.</li>
	<li>После выгрузки товары могут появляться не сразу, кроме того могут не сразу появляться загруженные значения в товарах: как текстовые/числовые, так и изображения.</li>
	<li>Не выгружайте в одном профиле много товаров - такие большие выгрузки сложно контролировать, при выгрузке могут быть сбои, и локализовать проблемы в таких случаях крайне сложно.</li>
	<li>Поле supplierId в новой версии API более не нужно. Всё теперь работает только по токену авторизации.</li>
	<li>Фотографии теперь выгружаются как и должны - без предварительной загрузки каждой их них на сервер WB.</li>
</ul>
<p>
	  
</p>
<h2>Как связаны опции «Режим работы ТП» и «Компоновка ТП»?</h2>
<p>
	 <span style="color:red"><b>Эти две опции крайне важны, без полного их понимания Вы не сможете корректно настроить выгрузку.</b></span>
</p>
<p>
	 Опция «Режим работы ТП» только производит отбор - товар и (или) ТП. И всё! Мы не сможем описать все варианты комбинаций выгрузки, но запомните правило: то, что модуль отобрал, обязательно будет выгружено либо как карточка, либо как номенклатура, либо как вариация. При этом имеются особенности. Например, если все ТП (к примеру, их всего 2) будут выгружаться как вариации, а в режиме ТП Вы выбрали «Только ТП», то модуль обязательно выберет также и товар, и сделает его карточкой (т.е. это будет основа для остального), но выгружены будут только 2 вариации. А если же Вы выбрали «Если у товара есть ТП - только ТП, иначе только товар» - то будет всё то же самое, но будут выгружены 3 вариации - т.е. сам товар как вариация и 3 ТП как вариации. Т.е. эту опцию можно рассматривать как первый этап выгрузки.
</p>
<p>
	 Опция «Компоновка ТП» определяет, по какой структуре будут выгружены подготовленные данные. Т.е. эта опция - второй этап выгрузки. Выгрузка на Wildberries во всех случаях предпогалает такую схему (всегда 3 сущности без исключений):
</p>
<ul>
	<li>Карточка
	<ul>
		<li>Номенклатура
		<ul>
			<li>Вариация</li>
		</ul>
 </li>
	</ul>
 </li>
</ul>
<p>
	 Задача описанных опций - правильно преобразовать одно- или двухуровневую структуру товаров Битрикса в трёхуровневую структуру Wildberries.<br>
	  
</p>
<h2>Возможные структуры выгрузки</h2>
<p>
	 Продолжая вопрос структуры, первая опция подразумевает два исхода - товар или ТП. Вторая опция содержит три варианта. На практике это приводит к различным структурам выгрузки.
</p>
