<h2>Почему в товарах и ТП повторяются некоторые поля?</h2>
<p>
	 Некоторые поля действительно повторяются (например, штрихкод, розничная цена, размеры) - это сделано для разных режимов структуры ТП. Например, в режиме «ТП как товар» каждое ТП выгружается как отдельный товар, поэтому для каждого ТП мы должны указывать свойства карточки, номенклатуры и вариации, при этом, если у нас выгружаются и товары, то такие же поля должны быть и в товарах. Соответственно, в этом режиме на обоих вкладках поля будут одинаковыми.
</p>
<p>
	 А в режиме «ТП как вариация» в конечной структуре в качестве вариации может выступать как сам товар, так и его предложения - поэтому поля настраиваются и там и там.
</p>

<br/>

<h2>Связь товаров сайта с товарами на Wildberries</h2>

<p>
	Товары на сайте связываются с товарами на Wildberries по трём параметрам: <code>supplierVendorCode</code> (для карточек), <code>vendorCode</code> (для номенклатур) и <code>barcode</code> (для вариаций).
</p>

<p>
	При выгрузке каждого товара модуль смотрит на значение, которые Вы выгружаете в поле <code>supplierVendorCode</code>: по этому значению модуль находит данный товар на Wildberries, и если товар найден - модуль будет его обновлять новыми данными, а если не найден - создаст новый.
</p>

<p>
	В случае, если товар найден, модуль анализирует текущую номенклатуру выгружаемого товара, и номенклатуру товара на Wildberries, смотря на поле <code>vendorCode</code>: если модуль находит номенклатуру с совпадающим <code>vendorCode</code>, он берёт из Wildberries её идентификатор и добавляет к выгружаемому, чтобы модуль знал, какую номенклатуру мы обновляем (если такого идентификатора нет, будет создана новая). Аналогично - и для вариаций.
</p>

<p>
	Таким образом, Вы получаете возможность обновлять все свои товары на Wildberries, в т.ч. созданные вручную.
</p>

<br/>

<h2>Порядок настройки</h2>
<ol>
	<li>
	<p>
		 Прежде всего, необходимо зарегистрироваться на портале поставщиков <a href="https://suppliers-portal.wildberries.ru/login/ru?redirect_url=/" target="_blank">Wildberries.ru</a>, просто авторизовавшись по номеру телефона. Сразу после регистрации потребуется указать основные данные о компании (страна, форма организации, наименование, ИНН, ФИО, ОКПО, ОГРНИП), тестирование будет доступно даже без подписания документов.
	</p>
 </li>
	<li>
	<p>
		 Теперь сгенерируйте на портале токен для авторизации («<a href="https://seller.wildberries.ru/supplier-settings/access-to-new-api">Доступ к новому API</a>»), указав произвольное название, и укажите его в настройках. Скопируйте его в профиль и нажмите «Проверить токен», чтобы убедиться в корректности.
	</p>
 </li>
	<li>
	<p>
		 Перейдите на вкладку «Настройки инфоблоков», выберите инфоблок, загрузится форма настроек. На вкладке «Категории» нажмите кнопку «Добавить категорию», и выберите необходимую категорию, начав набирать название (не забывайте, что мы рекомендуем для каждой категории настраивать свой профиль), затем нажмите «Сохранить». Новая категория добавить под кнопкой. Теперь необходимо нажать кнопку «Загрузить атрибуты категорий» чтобы загрузить атрибуты для категории, и затем - кнопку «Применить», чтобы новые атрибуты стали доступны как поля профиля.
	</p>
 </li>
	<li>
	<p>
		 Перейдите на вкладку «Настройки ТП» и выберите режим работы ТП. В большинстве случаев подходим режим «Если у товара есть ТП - только ТП, иначе только товар». На вкладке «Общие настройки» выберите подходящую структуру выгрузки.
	</p>
 </li>
	<li>
	<p>
		 Перейдите на вкладку «Поля товаров». Поочерёдно настраиваем каждое поле. Обязательные поля выделены жирным (если выбрана всего одна категория, если же категорий больше, то обязательные поля отмечены звёздочкой). Имейте в виду, что если у поля имеется жёлтый восклицательный знак, значит значения принимаются только из справочника, который можно открыть, щёлкнув по нему.
	</p>
 </li>
	<li>
	<p>
		 Категория для каждого товара должна быть указана отдельно. Т.е. по факту выгрузки у одного товара должна быть выгружена одна категория. Не допускается указывать значения вида "Туфли, ремни, шапки" - это просто не будет работать.
	</p>
 </li>
	<li>
	<p>
		 Аналогично настройте торговые предложения - для этого перейдите на вкладку «Поля ТП» и сделайте всё то же самое, набор полей при этом будет другим.
	</p>
 </li>
	<li>
	<p>
		 Для проверки того, как будет выгружаться товар, нажмите сочетание клавиш <code>Alt+F</code>: откроется страница первого товара, доступного для выгрузки, и сразу же откроется предпросмотр экспорта этого товара.
	</p>
 </li>
	<li>
	<p>
		 Теперь советуем настроить выгрузку только одного товара, это упростит проверку, и в случае неправильных данных уменьшит количество мусора в ЛК. Для этого после настройки полей и применения параметров профиля нажмите <code>Alt+F</code>, откроется товар и в нём - окно предпросмотра, необходимо закрыть окно предпросмотра, найти ID товара, и настроить по нему фильтр в профиле (вкладка «Фильтр»)
	</p>
 </li>
	<li>
	<p>
		 Теперь, когда выгрузка данных проверена (на предпросмотре) на одном товаре, необходимо ещё раз применить настройки профиля, и запустить выгрузку. Если выгрузка прошла успешно, следует перейти в <a href="https://suppliers-portal.wildberries.ru/goods/products-card/" target="_blank">ЛК Wildberries</a> и проверить результаты загрузки. В случае проблем смотрите вкладку «Лог и история» - в логе всегда можно понять какие проблемы происходят, и после этого их последовательно решать.
	</p>
 </li>
</ol>
<p>
	  
</p>
<h2>Об ошибках</h2>
<ul>
	<li><b>Внимание!</b> Операции выгрузки в Wildberries часто заканчиваются ошибками 502, 503, 504 - это проблемы на стороне Wildberries, в модуле добавлен механизм повторения попытки запроса при обнаружении подобных ошибок: на данный момент модуль будет предпринимать 5 попыток выполнения запроса.</li>
	<li><b>Внимание!</b> Ваши штрихкоды должны быть уникальными не только в пределах ваших товаров, но и в пределах всех товаров на Wildberries! Иначе Вы можете получать ошибку о том, что товар с таких штрихкодом уже есть, хотя среди Ваших товаров такого товара нет. <a href="#" data-role="acrit_exp_spoiler_toggle">Скриншот</a>
