		alt="Скриншот ТП Wildberries" style="height:auto; max-width:100%;" />
	</div>
</li>
	<li>Если при выгрузке стран-производителей значение выгружается пустым, попробуйте добавить изготовителей из необходимых стран и связать их с брендом из карточки <a href="https://suppliers-portal.wildberries.ru/goods-certificates" target="_blank">здесь</a>.</li>
	<li>Если Вы пытаетесь настроить сразу много категорий в одном профиле, Вы вряд ли сэкономите время на настройке: из-за большого количества полей браузер будет сильно тормозить при любых действиях на странице, в итоге Вы потеряете много времени. К тому же, при наличии проблем их будет решать гораздо сложнее.</li>
</ul>
